import React from 'react'
import { useSelector } from 'react-redux';

function Feed() {
    const user = useSelector((state) => state.user);
    return (
    <div>
        {user && <div>

          <img src="https://picsum.photos/v2/list" />
          
       
    

            </div>}
    
        {!user && <div className="alert alert-danger">Please login</div>}
    </div>
  )
}

export default Feed
